import { FormGroup, Label, Input, InputGroup, InputGroupAddon, InputGroupText, Row, Col } from 'reactstrap'

export default (props) => {
    return (
        <FormGroup 
            className={`mb-3 position-relative ${props.containerClassName ? props.containerClassName : ''}`}
            {...props.containerStyle}
        >
            {
                props.withLabel ?
                <Label for={props.formId} className={props.labelClassName}>{props.labelName}</Label> : ""
            }
            <InputGroup>
                <Row>
                    <Col xs="12" sm="12" md="12">
                        <Label className={props.labelClassName}>{props.labelInputGroup}</Label>
                    </Col>

                    <Col xs="12" sm="12" md="12">
                        <Input 
                        id={props.formIdInput} 
                        name={props.formNameInput} 
                        type={props.formTypeInput} 
                        placeholder={props.formPlaceholder}
                        onChange={props.onChange}
                        value={props.formValue} 
                        bsSize={props.formSize} />
                        <InputGroupAddon addonType="prepend">
                            <InputGroupText>
                                <Input 
                                    addon 
                                    id={props.formIdCheckbox} 
                                    name={props.formNameCheckbox} 
                                    type="checkbox" 
                                    aria-label="Checkbox for following text input" 
                                />
                            </InputGroupText>
                        </InputGroupAddon>
                    </Col>
                </Row>

            </InputGroup>
            {/* <Input 
                className={props.formClassName} 
                id={props.formId} 
                type={props.formType} 
                name={props.formName} 
                placeholder={props.formPlaceholder} 
                onChange={props.onChange} 
                related={props.formRelation}
                value={props.formValue}
                bsSize={props.formSize} */}
        </FormGroup>
    )
}
